import React from 'react';
import "./home.css";
import ME from '../../collateral/auguri.png'

const Home = () => {
  return (
    <section className="home section" id='home'>
      <div className="introduction">
        <img className="home-image" src={ME} />
        <h1 className="home-name">
          RHOMAR A. LLANILLO
          <span className="home-name">AUGURI | MAX</span>
        </h1>
        <span className="home-education"></span>

      </div>
    </section>
  )
}

export default Home
